(1, 'আকন্দের বাইদ ছাবেদীয়া দাখিল মাদ্রাসা', 'শিক্ষা জাতির মেরুদন্ড', '১৯৭৫ইং সন', '১১৪১৮৪', '', 'Logo2.png', '', '+৮৮০-১৭৭৪ ৯৬৭১৯১', 'absdakhilmadrasah@gmail.com', 'ডাকঘর : লোহানী সাগরদিঘী, উপজেলা : ঘাটাইল,  টাংগাইল।', 'http://www.institute.edu.bd', 'http://www.tritiyo.com', 'সকাল ১০.০০টা থেকে বিকাল-০৪.০০টা।', '<iframe src=\"https://www.google.com/maps/embed?pb=!1m10!1m8!1m3!1d3629.5725033535746!2d89.9839227!3d24.5348707!3m2!1i1024!2i768!4f13.1!5e0!3m2!1sen!2sbd!4v1437993374527\" allowfullscreen></iframe>', 'টাংগাইল জেলার ঘাটাইল উপজেলাধীন আকন্দের বাইদ গ্রামে এক মনোরম পরিবেশে ১৯৭৫ ইং সনে এলাকার গণ্যমান্য ব্যক্তিবর্গের ঐকান্তিক প্রচেষ্টায় গড়ে ওঠে ছিল এই আকন্দের বাইদ ছাবেদীয়া দাখিল মাদ্রাসা, সেই থেকে এর পথ চলা। মাদ্রাসাটি এলাকার দরিদ্র জনগোষ্টির মাঝে ইসলামী শিক্ষার পাশাপাশি আধুনিক বিজ্ঞান ও প্রযুক্তিগত শিক্ষার আলো ছড়িয়ে আসছে।', 'সৈয়দ মোস্তফা-সুপার', '+৮৮০-১৭৭৪ ৯৬৭১৯১', 'absdakhilmadrasah@gmail.com', 'Super1.jpg', '1537676992400313967723.jpg', ' শিক্ষার জ্ঞান মানুষের মনের প্রসারন, জীবন ও পৃথিবী সম্বন্ধে নতুন চিন্তার উদ্ভাবন ঘটায়। আর শিক্ষা জাতির মেরুদন্ড হয়ে দাড়ায় তখনই, যখন জাতি মানরীয় মূল্যবোধে উজ্জীবিত হয়ে শিক্ষা বান্ধব স্থিতিশীল সমাজ ও রাষ্ট্র প্রতিষ্ঠার মাধ্যমে উন্নত থেকে উন্নততর ভবিষ্যৎ নির্মাণে চেষ্ঠিত হয়। আর এজন্য প্রয়োজন সুশিক্ষা, জ্ঞান অর্জনে সুশিক্ষার কোন বিকল্প নেই। আমাদের উচিত সুশিক্ষার মাধ্যমে নীতি নৈতিকতা বিচার বুদ্ধি বোধকে জাগ্রত করে দেশাত্ব বোধের চেতনায় উজ্জীবিত হয়ে নিজেকে সুনাগরিক হিসাবে গড়ে তোলার লক্ষ্যে সঠিক ভাবে কর্মকে সুনিয়ন্ত্রিত করা। অত্র মাদ্রাসাটি পাহাড়ি এলাকার ছেলে-মেয়েদের সুশিক্ষা অর্জনের লক্ষ্যে ১৯৭৫ সনে প্রতিষ্ঠিত হয়ে ১৯৮৬ সনে দাখিল মাদ্রাসা হিসাবে স্বীকৃতি লাভ করে এবং ০১/০১/১৯৮৬ সনেই এম.পি.ও ভূক্ত হয়। মাদ্রাসাটিতে ছাত্র/ছাত্রীদের জন্য মাদ্রাসা কর্তৃপক্ষ নির্ধারিত পোষাক ও নির্দিষ্ট সময়ে পাঠদান ও পরীক্ষা সম্পন্ন করার জন্য সর্বদাই সচেষ্ট। শৃংঙ্খলা বোধ, দেশ প্রেমিক ও যোগ্য নাগরিক গড়ে তুলতে দক্ষ ও অভিজ্ঞ প্রশিক্ষণ প্রাপ্ত শিক্ষক মন্ডলীর নিরলস প্রচেষ্টায় পাঠোন্নয়ন মনিটরিং শিক্ষার্থীদের দাপ্তরিক কার্যক্রম সহজতর করনে কর্মচারিদের একাগ্রতা এবং পরিষ্কার পরিচ্ছন্ন ও নিরিবিলি পরিবেশ মাদ্রাসাটির অন্যতম বৈশিষ্ট্য। শিক্ষার্থীদের মেধা বিকাশে সংশ্লিষ্ট সকলের সহযোগিতায় ছাত্র/ছাত্রীদের নিরাপত্তা বিধানে মাদ্রাসা কর্তৃপক্ষ দৃঢ় প্রতিজ্ঞ। পরিশেষে মাদ্রাসাটিরে উত্তরোত্তর সাফল্য কামনা করছি। এবং সেই সঙ্গে মহান আল্লাহ রাব্বুল আলামীনের নিকট প্রার্থনা করছি যেন এই প্রতিষ্ঠানটি টাংগাইল জেলার একটি অন্যতম দ্বীনি প্রতিষ্ঠান হিসাবে কবুল করেন।\r\nআ মী ন.                                                                   \r\n', 'blankavatar.jpg', 'bluetheme');
