(55, 'ইতিহাস', 'history', NULL, 1, 4, 'টাংগাইল জেলার ঘাটাইল উপজেলাধীন আকন্দের বাইদ গ্রামে এক মনোরম পরিবেশে ১৯৭৫ ইং সনে এলাকার গণ্যমান্য ব্যক্তিবর্গের ঐকান্তিক প্রচেষ্টায় গড়ে ওঠে ছিল এই আকন্দের বাইদ ছাবেদীয়া দাখিল মাদ্রাসা, সেই থেকে এর পথ চলা। মাদ্রাসাটি এলাকার দরিদ্র জনগোষ্টির মাঝে ইসলামী শিক্ষার পাশাপাশি আধুনিক বিজ্ঞান ও প্রযুক্তিগত শিক্ষার আলো ছড়িয়ে আসছে।', '1450401420', 0, 1, 1);
