(59, 'প্রতিষ্ঠাতার ইতিহাস', 'founder-history', NULL, 1, 0, 'টাংগাইল জেলার ঘাটাইল উপজেলাধীন আকন্দের বাইদ গ্রামে এক মনোরম পরিবেশে ১৯৭৫ ইং সনে এলাকার গণ্যমান্য ব্যক্তিবর্গের ঐকান্তিক প্রচেষ্টায় গড়ে ওঠে ছিল এই আকন্দের বাইদ ছাবেদীয়া দাখিল মাদ্রাসা, সেই থেকে এর পথ চলা। মাদ্রাসাটি এলাকার দরিদ্র জনগোষ্টির মাঝে ইসলামী শিক্ষার পাশাপাশি আধুনিক বিজ্ঞান ও প্রযুক্তিগত শিক্ষার আলো ছড়িয়ে আসছে।', '1450934753', 0, 1, 1),
(60, 'সাবেক প্রধান শিক্ষকের তালিকা', 'xheadteacher', NULL, 1, 0, '<table class=\"table table-bordered\">\r\n	<tbody>\r\n		<tr>\r\n			<td>নং</td>\r\n			<td>নাম</td>\r\n			<td>পদবী</td>\r\n		</tr>\r\n		<tr>\r\n			<td>০১</td>\r\n			<td>এ.ট.িএম আব্দুছ ছামাদ</td>\r\n			<td>সুপারণিটনেডন্টে</td>\r\n		</tr>\r\n		<tr>\r\n			<td>০২</td>\r\n			<td>মুহাম্দ আমনি উদ্দনি</td>\r\n			<td>ভারপ্রাপ্ত সুপার</td>\r\n		</tr>\r\n	</tbody>\r\n</table>', '1450934458', 0, 1, 1);
