(61, 'প্রতিষ্ঠান প্রধানের বার্তা', 'messageofheadteacher', NULL, 21, 0, ' শিক্ষার জ্ঞান মানুষের মনের প্রসারন, জীবন ও পৃথিবী সম্বন্ধে নতুন চিন্তার উদ্ভাবন ঘটায়। আর শিক্ষা জাতির মেরুদন্ড হয়ে দাড়ায় তখনই, যখন জাতি মানরীয় মূল্যবোধে উজ্জীবিত হয়ে শিক্ষা বান্ধব স্থিতিশীল সমাজ ও রাষ্ট্র প্রতিষ্ঠার মাধ্যমে উন্নত থেকে উন্নততর ভবিষ্যৎ নির্মাণে চেষ্ঠিত হয়। আর এজন্য প্রয়োজন সুশিক্ষা, জ্ঞান অর্জনে সুশিক্ষার কোন বিকল্প নেই। আমাদের উচিত সুশিক্ষার মাধ্যমে নীতি নৈতিকতা বিচার বুদ্ধি বোধকে জাগ্রত করে দেশাত্ব বোধের চেতনায় উজ্জীবিত হয়ে নিজেকে সুনাগরিক হিসাবে গড়ে তোলার লক্ষ্যে সঠিক ভাবে কর্মকে সুনিয়ন্ত্রিত করা। অত্র মাদ্রাসাটি পাহাড়ি এলাকার ছেলে-মেয়েদের সুশিক্ষা অর্জনের লক্ষ্যে ১৯৭৫ সনে প্রতিষ্ঠিত হয়ে ১৯৮৬ সনে দাখিল মাদ্রাসা হিসাবে স্বীকৃতি লাভ করে এবং ০১/০১/১৯৮৬ সনেই এম.পি.ও ভূক্ত হয়। মাদ্রাসাটিতে ছাত্র/ছাত্রীদের জন্য মাদ্রাসা কর্তৃপক্ষ নির্ধারিত পোষাক ও নির্দিষ্ট সময়ে পাঠদান ও পরীক্ষা সম্পন্ন করার জন্য সর্বদাই সচেষ্ট। শৃংঙ্খলা বোধ, দেশ প্রেমিক ও যোগ্য নাগরিক গড়ে তুলতে দক্ষ ও অভিজ্ঞ প্রশিক্ষণ প্রাপ্ত শিক্ষক মন্ডলীর নিরলস প্রচেষ্টায় পাঠোন্নয়ন মনিটরিং শিক্ষার্থীদের দাপ্তরিক কার্যক্রম সহজতর করনে কর্মচারিদের একাগ্রতা এবং পরিষ্কার পরিচ্ছন্ন ও নিরিবিলি পরিবেশ মাদ্রাসাটির অন্যতম বৈশিষ্ট্য। শিক্ষার্থীদের মেধা বিকাশে সংশ্লিষ্ট সকলের সহযোগিতায় ছাত্র/ছাত্রীদের নিরাপত্তা বিধানে মাদ্রাসা কর্তৃপক্ষ দৃঢ় প্রতিজ্ঞ। পরিশেষে মাদ্রাসাটিরে উত্তরোত্তর সাফল্য কামনা করছি। এবং সেই সঙ্গে মহান আল্লাহ রাব্বুল আলামীনের নিকট প্রার্থনা করছি যেন এই প্রতিষ্ঠানটি টাংগাইল জেলার একটি অন্যতম দ্বীনি প্রতিষ্ঠান হিসাবে কবুল করেন। আ মী ন. ', '1450938847', 0, 1, 1),
